import React, { useState, useEffect } from 'react';
import './cars.css';
import Sidebar from '../Sidebar/sidebar';

const Cars = ({ user }) => {
  const [cars, setCars] = useState([]);
  useEffect(() => {
    fetch(`http://localhost:5000/dashboard/cars/${user.googleId}`)
      .then(response => response.json())
      .then(data => {
        console.log(data);
        setCars(data);
      })
      .catch(error => console.error(error));
  }, [user.googleId]);
  return (
    <>
      <Sidebar user={user} />
      <div className="bigbox">
        <h1>YOUR CARS</h1>
        <table>
          <thead>
            <tr>
              <th>Model</th>
              <th>Brand</th>
              <th>Year</th>
            </tr>
          </thead>
          <tbody>
            {Array.isArray(cars) && cars.map(car => (
              <tr key={car._id}>
                <td>{car.carModel}</td>
                <td>{car.carBrand}</td>
                <td>{car.carYear}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </>
  )
}

export default Cars;
